import React from 'react';
import './App.css';
import { EventCard } from './layouts/homepage/EventCard/EventCard';
import EventModel from './models/EventModel';
import OptionModel from './models/OptionModel';

function App() {

  const firstEvent: EventModel = 
  new EventModel(
    0,
    "Where do we find you in the tavern at this time?", 
    false, 
    [
      new OptionModel(
        0,
        "Bar",
        new EventModel(
          1,
          "Grab a Tankard and have a seat!",
          false,
          []
        )
      ),
      new OptionModel(
        1,
        "Dining Room",
        new EventModel(
          2,
          "Get a Knife ready for the meal to come.",
          false,
          []
        )
      ),
      new OptionModel(
        2,
        "Library",
        new EventModel(
          3,
          "Ah. Looking for a good read? Grab that book over there: Tome of Bludgeoning. It is a good read. I promise.",
          false,
          []
        )
      ),
      new OptionModel(
        3,
        "My Room",
        new EventModel(
          4,
          "There is a bucket near the bed for... Y'know? If you need it.",
          false,
          []
        )
      )
    ]
  );

  return (
    <div className="App">
      <EventCard prompt={"undefined"} options={[]}/>
    </div>
  );
}

export default App;
